import React, {Component} from "react";

class Ranklist extends Component{
    render() {
        return(
            <>
                <div className="img-wrap">
                    <img
                        src="//m.360buyimg.com/babel/s800x86_jfs/t1/74449/19/2451/11348/5d0b6b88E125ed4ad/652be683dc6fbf4a.jpg!q70.dpg"
                        className="lazyload-img hotzone-pic lazyload-img-wmh size50 transparent big-width loaded"
                        data-resize="1" style="background-color: transparent; background-image: none;"/>
                </div>
            </>
        );
    }
}
export default Ranklist
